    left:windowSizeY/2 + "px"
  }
  const massege = "< 로그인 >"

  return (
    <div id="container">
      <h1 id="center">{massege}</h1>
      <h2>Username: <input name="username" type="text" /></h2>
      <h2>Password: <input name="password" type="password" /></h2>
      <button className="button">로그인</button>
      <button className="button" id="nextUser">신규가입</button>
    </div>
  )
}

export default app;
